var $bm_rt;
var bounceWidth, targetScale, timeToMarker;
try {
    bounceWidth = $bm_div(effect('Scale Bounce - layer markers')('Bounce Duration (msec)'), 2000);
    targetScale = effect('Scale Bounce - layer markers')('Target Scale Change');
    timeToMarker = Math.abs($bm_sub(time, marker.nearestKey(time).time));
    $bm_rt = easeIn(timeToMarker, bounceWidth, 0, targetScale, 100);
} catch (err1) {
    $bm_rt = 100;
}

